/**
 * @param {number[]} nums
 * @return {number}
 */
var maximumTripletValue = function(nums) {
    let maxVal = 0; // Initialize maximum value to 0
    for (let i = 0; i < nums.length - 2; i++) {
        for (let j = i + 1; j < nums.length - 1; j++) {
            for (let k = j + 1; k < nums.length; k++) {
                // Calculate the value of the current triplet
                let currentValue = (nums[i] - nums[j]) * nums[k];
                // Update maxVal if currentValue is greater
                maxVal = Math.max(maxVal, currentValue);
            }
        }
    }
    return maxVal;
};
